    DETERMINISTIC
BEGIN
       DECLARE v_cedula_generada INT(8) DEFAULT 0;
       DECLARE v_bandera_cedula_valida BOOLEAN DEFAULT FALSE;
       
       WHILE NOT v_bandera_cedula_valida DO 
			SET v_cedula_generada = fn_numero_aleatorio_rangos(1,99999999);
